import {connect} from 'react-redux'

class List  extends Component {
    state = {  }
    render() { 
        console.log('11111', this.props);
        return ( <div
        style={{
            display: 'flex',
            alignItems: 'center',
            marginTop: '120px',
            justifyContent: 'center',
            flexDirection: 'column'
        }}
        >
            <div style={{display: 'flex', flexDirection: 'row'}}>
                <p style={{fontSize: 30}}>Hi, </p>
                <p style={{marginLeft: '50px', fontSize: 30, fontWeight: 'bold'}}>{this.props.UserDetails.userName}</p>
            </div>


        {this.props.UserDetails.isAdmin ? (
               <div style={{
                marginTop: '35px', 
           // height: '60px', 
            width: '300px',
            backgroundColor: 'blue',
            alignItems: 'center',
            justifyContent: 'center'
            }}
           onClick={() => alert('user added!')}
            >
                 <p style={{color: 'white', fontSize: 24, textAlign: 'center'}}>Add user</p>
            </div>
        ) : null}

        </div> );
    }
}

const mapStateToProps = (state) => ({
    UserDetails: state.UserDetails
})

export default connect(mapStateToProps)(List);
